import React from 'react';
import { Instagram, Twitter, TikTok } from 'lucide-react';

const MigoLandingPage = () => {
  return (
    <div className="h-screen w-screen bg-gradient-to-br from-[#ebf4f5] to-[#b5c6e0] flex items-center justify-center relative overflow-hidden">
      <div className="w-[90%] h-[90%] bg-white rounded-[50px] shadow-lg flex flex-col items-center justify-center">
        <h1 className="text-6xl font-bold mb-4">Migo</h1>
        <h2 className="text-2xl mb-8">Find your people.</h2>
        <button className="bg-black text-white px-6 py-3 rounded-full text-lg hover:bg-gray-800 transition-colors">
          Join the waitlist
        </button>
      </div>

      <div className="absolute bottom-4 right-4 flex flex-col items-end">
        <div className="flex space-x-4 mb-2">
          <button className="p-2 hover:bg-gray-200 rounded-full transition-colors">
            <Instagram size={24} />
          </button>
          <button className="p-2 hover:bg-gray-200 rounded-full transition-colors">
            <TikTok size={24} />
          </button>
          <button className="p-2 hover:bg-gray-200 rounded-full transition-colors">
            <Twitter size={24} />
          </button>
        </div>
        <p className="text-sm">&copy; Migo 2024</p>
      </div>
    </div>
  );
};

export default MigoLandingPage;
